import React from "react";
import styled from "styled-components";

export default function Navbar() {
  const navbardata = [
    "Maintainance",
    "HouseHoldThing",
    "Medical Facilities",
    "About",
  ];
  return (
    <MainContainer>
      <NavbarMainContainer>
        <LogoImg>
          <img
            src="/navbarimgcontainer/householdwebsitelogo.jpg"
            alt="HouseHoldWebsite"
          />
        </LogoImg>
        <NavbarContent>
          <ul>
            {navbardata.map((data, i) => {
              return <li key={i}>{data}</li>;
            })}
          </ul>
        </NavbarContent>
      </NavbarMainContainer>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  border: 2px solid yellowgreen;
`;

const NavbarMainContainer = styled.nav`
  border: 2px solid crimson;
  width: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: <space-bet></space-bet>;
`;

const LogoImg = styled.div`
  border: 2px solid aqua;
  width: 10%;
  img {
    width: 100%;
    border: 2px solid purple;
  }
`;

const NavbarContent = styled.div`
  border: 2px solid pink;
  ul{
    display: flex;
    flex-direction: row;
    align-items: center;
  }
`;
